import React from 'react'
// import { AppContext } from '../App';
// import { useContext } from 'react';
import { useNavigate } from "react-router-dom";
import background from '../background.jpg'
import ShoppingPic from '../Shopping.png'

function PersonalPage() {
  // const {setPagination} = useContext(AppContext)
  const navigate = useNavigate();
  function home() {
    navigate('/home')
  }
  function babyplanner() {
    navigate('/babyplanner')
  }
  function data() {
    navigate('/data')
  }
  function profile() {
    navigate('/personal')
  }
  return (
    <div className='personal' style={{ backgroundImage: `url(${background})` }}>
    {/* <img src={backgroundPic} alt="" /> */}
    <div className="personal-buttons">  
          <button onClick={home} className="btn1">
            Home
          </button>
          <button onClick={babyplanner} className="btn2">
            Babyplanner
          </button>
          <button onClick={data} className="btn3">
            Data
          </button>
          <button onClick={profile} className="btn4">
            Profile
          </button>
    </div>
    <div className='personal-content'>
      <div className='p-content1'>
        <button className='b1'>Beauty</button>
        <button className='b2'><img src={ShoppingPic} alt="" /></button>
        <button className='b3'><img src={heartPic} alt="" /></button>
        <button className='b4'>Chats</button>
      </div>
      <div className='p-content2'>
        <button className='b5'>Services</button>
        <button className='b6'>Events</button>
        <button className='b7'>Rest</button>
        <button className='b8'>Emergency</button>
      </div>
    </div>
    <div><h1>This is my personal page</h1>
          </div>
    </div>
  )
}

export default PersonalPage
